// src/components/Settings.js
import React from 'react';
import { Box, Grid, Typography, Paper, Button, Switch, FormControlLabel, Divider } from '@mui/material';
import { styled } from '@mui/material/styles';
import { Lock, Notifications, CalendarToday, AccountCircle, Security, Payment } from '@mui/icons-material';
import { useNavigate } from 'react-router-dom'; // Import useNavigate for navigation

const Settings = () => {
  const navigate = useNavigate();

  // Handlers for button actions
  const handleUpdatePersonalDetails = () => {
    navigate('/personal-details'); // Navigate to the Personal Details page
  };

  const handleUpdatePaymentDetails = () => {
    alert('Update Payment Details clicked');
  };

  return (
    <Box component="main" sx={{ flexGrow: 1, p: 3, backgroundColor: '#2c2c2c', color: '#fff', minHeight: '100vh' }}>
      <Grid container spacing={2}>
        <Grid item xs={12}>
          <Box display="flex" justifyContent="space-between" alignItems="center">
            <Typography variant="h4">Settings</Typography>
          </Box>
        </Grid>

        {/* Personal Details Button at the top of Account Management */}
        <Grid item xs={12}>
          <StyledPaper>
            <Button 
              variant="contained" 
              sx={{ mb: 2, backgroundColor: 'teal', color: '#fff' }} 
              onClick={handleUpdatePersonalDetails}
            >
              Personal Details
            </Button>
            <Box display="flex" alignItems="center">
              <AccountCircle sx={{ color: 'teal', marginRight: 2 }} />
              <Typography variant="h6">Account Management</Typography>
            </Box>
            <Divider sx={{ my: 2 }} />
            <Typography variant="body1">Manage your account settings.</Typography>
            <FormControlLabel
              control={<Switch color="primary" />}
              label="Link Google Account"
            />
            <FormControlLabel
              control={<Switch color="primary" />}
              label="Link Facebook Account"
            />
          </StyledPaper>
        </Grid>

        {/* Notifications */}
        <Grid item xs={12}>
          <StyledPaper>
            <Box display="flex" alignItems="center">
              <Notifications sx={{ color: 'teal', marginRight: 2 }} />
              <Typography variant="h6">Notifications</Typography>
            </Box>
            <Divider sx={{ my: 2 }} />
            <FormControlLabel
              control={<Switch color="primary" />}
              label="Email Notifications"
            />
            <FormControlLabel
              control={<Switch color="primary" />}
              label="App Notifications"
            />
          </StyledPaper>
        </Grid>

        {/* Calendar Integration */}
        <Grid item xs={12}>
          <StyledPaper>
            <Box display="flex" alignItems="center">
              <CalendarToday sx={{ color: 'teal', marginRight: 2 }} />
              <Typography variant="h6">Calendar Integration</Typography>
            </Box>
            <Divider sx={{ my: 2 }} />
            <Typography variant="body1">Sync your study schedule with Google Calendar.</Typography>
            <FormControlLabel
              control={<Switch color="primary" />}
              label="Sync with Google Calendar"
            />
          </StyledPaper>
        </Grid>

        {/* Privacy and Security */}
        <Grid item xs={12}>
          <StyledPaper>
            <Box display="flex" alignItems="center">
              <Security sx={{ color: 'teal', marginRight: 2 }} />
              <Typography variant="h6">Privacy and Security</Typography>
            </Box>
            <Divider sx={{ my: 2 }} />
            <FormControlLabel
              control={<Switch color="primary" />}
              label="Enable Two-Factor Authentication"
            />
          </StyledPaper>
        </Grid>

        {/* Payment Details */}
        <Grid item xs={12}>
          <StyledPaper>
            <Box display="flex" alignItems="center">
              <Payment sx={{ color: 'teal', marginRight: 2 }} />
              <Typography variant="h6">Payment Details</Typography>
            </Box>
            <Divider sx={{ my: 2 }} />
            <Typography variant="body1">Manage your payment methods and billing information.</Typography>
            <Button 
              variant="contained" 
              sx={{ mt: 2, backgroundColor: 'teal', color: '#fff' }} 
              onClick={handleUpdatePaymentDetails}
            >
              Update Payment Details
            </Button>
          </StyledPaper>
        </Grid>
      </Grid>
    </Box>
  );
};

const StyledPaper = styled(Paper)({
  padding: '20px',
  marginBottom: '20px',
  backgroundColor: '#333',
  color: '#fff',
  borderRadius: '8px',
  boxShadow: '0 4px 8px rgba(0, 0, 0, 0.2)',
});

export default Settings;
